import Article from "../article/Article";
import PostsData from "../../data/posts";
import { useState } from "react";

const Main = ()=>{
    return(
    <main>
        <div className="container">
            <h1>Naujienos</h1>
            {PostsData.map((post)=>
            <Article tittle={post.title} description={post.description}/>
            )}
        </div>
    </main>    
  )
}
export default Main
